function Java(props){
    const {a,b,c,d,e}=props
    return(
        <div>
          <p>Name:{a}</p>
          <p>Age:{b}</p>
          <p>State:{c}</p>
          <p>City:{d}</p>
          <p>Mobile:{e}</p>
        </div>
    )
}

export default Java;
